const PrivateRoute = ({component: Component, ...rest }) => {
  const { currentUser } = useAuth();
  const test = false;
  return (
    <Routes>
      <Route {...rest} render={(props)=> {
        return test === true ? <Component {...props} /> : <Navigate to="/login" />;
